import axios from 'axios'
import React, {useState, useEffect} from 'react'

export function useAxiosGet(url,pageNumber) {
    const [request, setRequest] = useState({
        loading:false,
        data:null,
        error:false
    })
    const [hasMore, setHasMore] = useState(false)

    useEffect(() => {
        setRequest({
            loading:true,
            data:null,
            error:false
        })
        axios(url + "&page=" + pageNumber)
            .then(response => {
                setRequest({
                    loading:false,
                    data:response.data,
                    error:false
                })
                setHasMore(response.data.page < response.data.total_pages)
            })
            .catch(() => {
                setRequest({
                    loading:false,
                    data:null,
                    error:true
                })
            })
    },[url,pageNumber])
    return request;
}
